-mobile) .css-yet5q6[data-is-thematic=""false""],.container-size-medium:not(.device-mobile) [data-is-thematic=""false""] .css-yet5q6,.container-size-large:not(.device-mobile) .css-yet5q6[data-is-thematic=""false""],.container-size-large:not(.device-mobile) [data-is-thematic=""false""] .css-yet5q6,.container-size-extra-large:not(.device-mobile) .css-yet5q6[data-is-thematic=""false""],.container-size-extra-large:not(.device-mobile) [data-is-thematic=""false""] .css-yet5q6{opacity:0;}</style><section><article class=""css-19fajos burst"" id=""RGlzcGF0Y2g6Njg1NA=="" data-testid=""dispatch"" role=""region"" aria-label=""carousel""><div class=""css-mx836u""><div class=""css-emebgk"" role=""button"" tabindex=""0""><section class=""css-s23jeo cards"" data-testid=""cards""><div data-scrolled-index=""0"" class=""swiper css-kc6ac7"" data-testid=""swiper""><div class=""css-1mevlcl"" aria-hidden=""false""><div class=""title-card css-1d2zsbt"" data-index=""0"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""title"" data-is-active=""true"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-17vu60v"" data-testid=""title""><h2 class=""css-21euek"">6 New Paperbacks to Read This Week </h2></div><figure class=""css-oojl3y"" data-testid=""byline""><span><div class=""css-1wkhj5w""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-x8cjq2""><picture class=""""><img alt=""Shreya Chattopadhyay"" src=""https://static01.nyt.com/images/2023/06/08/books/author-Shreya-Chattopadhyay/author-Shreya-Chattopadhyay-thumbStandard.png?quality=75&amp;auto=webp"" class=""css-oyab1k""/></picture></div></div></div></span><span class=""css-zupw4a""><span data-testid=""author-name"" class=""css-1p25phx"">Shreya Chattopadhyay</span><span data-testid=""author-desc"" class=""css-8g95dj"">Reporting for the Books Desk </span></span></figure></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">If you’re searching for your next read, try these new paperback releases: Annie Proulx’s history of the world’s wetlands, Tess Gunty’s award-winning novel of a young woman in crisis, David Maraniss’s biography of Jim Thorpe and more. </p><p class=""css-131ft9l"">Here are six paperbacks we recommend →</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""1"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">Fen, Bog &amp; Swamp: A Short History of Peatland Destruction and Its Role in the Climate Crisis, by Annie Proulx</div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">Proulx combines personal reflections with a literary-historical account of earth’s wetlands, their important carbon-sinking properties and their systematic degradation in the American West and elsewhere. “In the end,” she writes, “all humans will be ‘haunted by waters.’” </p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""2"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">The Rabbit Hutch, by Tess Gunty </div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">As 18-year-old Blandine Watkins exits her body in Apartment C4 of a rundown building in postindustrial Vacca Vale, Ind., she thinks, “The agony is sweet, as the mystics promised.” Gunty’s novel, which won the 2022 National Book Award for fiction, traces the events — economic, personal, supernatural — that led Blandine here.</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""3"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">Path Lit by Lightning: The Life of Jim Thorpe, by David Maraniss</div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">Jim Thorpe was a track and field Olympian, a football Hall of Famer, a major-league baseball player and a graduate of the notoriously abusive Carlisle Indian School. Maraniss’s comprehensive biography highlights the great athlete’s successes and pains.</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""4"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">The Mountain in the Sea, by Ray Nayler</div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">In a near-future dystopia populated by humans, computerized constructs and at least one android, Dr. Ha Nguyen studies octopuses with language and culture living near an island owned by an international tech corporation. Her scientific breakthroughs lead to conflict between Nguyen, the larger world and the octopuses themselves.</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""5"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">Raising Lazarus: Hope, Justice, and the Future of America’s Overdose Crisis, by Beth Macy</div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">After exploring the causes of the opioid crisis in her 2018 book “Dopesick,” the journalist Macy turns her eye to solutions like harm reduction. The result, wrote our reviewer, Jan Hoffman, is Macy “at her full-bore fearless best. Heartsick and determined, she grills drug policy scholars and former drug czars alike.”</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""content-card css-yet5q6"" data-index=""6"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""content"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-6gi9n3"" data-has-expandable-block=""false"" data-testid=""document-block""><header class=""css-10odt3p"" data-testid=""title-byline""><figure class=""css-1na6c6h""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-9gujjy""><svg width=""100%"" height=""100%"" xmlns=""http://www.w3.org/2000/svg"" version=""1.1""></svg></div></div><figcaption class=""css-1wfdaj8"" data-testid=""legend""></figcaption></figure><div class=""css-ididjv"" data-testid=""subheadline"">More Than You’ll Ever Know, by Katie Gutierrez</div></header><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l"">In the 1980s, Lore Rivera secretly has two families, one in Texas, one in Mexico City, until her first husband finds out and murders the other. In 2017, the true-crime journalist Cassie Bowman is enticed by Rivera’s motivations for her double life. She learns more than she bargained for in this suspenseful debut novel.</p></div></div></div></div><div class=""css-1mevlcl"" aria-hidden=""true""><div class=""exit-card css-bpzlko"" data-index=""7"" data-dispatch-id=""RGlzcGF0Y2g6Njg1NA=="" data-items-length=""8"" data-card-type=""exit"" data-is-active=""false"" data-is-square-full-bleed=""false"" data-testid=""card""><div class=""css-1m1wk0n"" data-has-expandable-block=""false"" data-testid=""document-block""><div class=""css-fsvbgy"" data-testid=""document-block-body""><p class=""css-131ft9l""><strong class=""css-1nu2zqw"" data-testid=""bold"">Read more books news: </strong></p><ul class=""css-vaopzn"" data-component=""related-links-block""><li class=""related-link""><a href=""https://www.nytimes.com/2023/06/22/books/booksupdate/bookforum-the-nation.html""><div data-testid=""related-link-headline"" class=""css-1a7k0uh"">Bookforum Is Returning, Months After Its Closure Was Mourned in the Literary World</div></a><a class=""related-link-img"" href=""https://www.nytimes.com/2023/06/22/books/booksupdate/bookforum-the-nation.html""><div class=""css-ohwg9z"" data-testid=""image-holder""><div data-testid=""placeholder"" class=""css-fkw33t""><picture class=""""><img alt=""The photo shows various, colorful covers of the magazine Bookforum. "" src=""https://static01.nyt.com/images/2023/06/22/books/review/22BOOKFORUM/22BOOKFORUM-mediumSquare149.jpg?quality=75&amp;a