ss=\""title-card css-1d2zsbt\"" data-index=\""0\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""title\"" data-is-active=\""true\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-17vu60v\"" data-testid=\""title\""\u003E\u003Ch2 class=\""css-21euek\""\u003E6 New Paperbacks to Read This Week \u003C\u002Fh2\u003E\u003C\u002Fdiv\u003E\u003Cfigure class=\""css-oojl3y\"" data-testid=\""byline\""\u003E\u003Cspan\u003E\u003Cdiv class=\""css-1wkhj5w\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-x8cjq2\""\u003E\u003Cpicture class=\""\""\u003E\u003Cimg alt=\""Shreya Chattopadhyay\"" src=\""https:\u002F\u002Fstatic01.nyt.com\u002Fimages\u002F2023\u002F06\u002F08\u002Fbooks\u002Fauthor-Shreya-Chattopadhyay\u002Fauthor-Shreya-Chattopadhyay-thumbStandard.png?quality=75&amp;auto=webp\"" class=\""css-oyab1k\""\u002F\u003E\u003C\u002Fpicture\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fspan\u003E\u003Cspan class=\""css-zupw4a\""\u003E\u003Cspan data-testid=\""author-name\"" class=\""css-1p25phx\""\u003EShreya Chattopadhyay\u003C\u002Fspan\u003E\u003Cspan data-testid=\""author-desc\"" class=\""css-8g95dj\""\u003EReporting for the Books Desk \u003C\u002Fspan\u003E\u003C\u002Fspan\u003E\u003C\u002Ffigure\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EIf you’re searching for your next read, try these new paperback releases: Annie Proulx’s history of the world’s wetlands, Tess Gunty’s award-winning novel of a young woman in crisis, David Maraniss’s biography of Jim Thorpe and more. \u003C\u002Fp\u003E\u003Cp class=\""css-131ft9l\""\u003EHere are six paperbacks we recommend →\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""1\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003EFen, Bog &amp; Swamp: A Short History of Peatland Destruction and Its Role in the Climate Crisis, by Annie Proulx\u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EProulx combines personal reflections with a literary-historical account of earth’s wetlands, their important carbon-sinking properties and their systematic degradation in the American West and elsewhere. “In the end,” she writes, “all humans will be ‘haunted by waters.’” \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""2\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003EThe Rabbit Hutch, by Tess Gunty \u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EAs 18-year-old Blandine Watkins exits her body in Apartment C4 of a rundown building in postindustrial Vacca Vale, Ind., she thinks, “The agony is sweet, as the mystics promised.” Gunty’s novel, which won the 2022 National Book Award for fiction, traces the events — economic, personal, supernatural — that led Blandine here.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""3\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003EPath Lit by Lightning: The Life of Jim Thorpe, by David Maraniss\u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EJim Thorpe was a track and field Olympian, a football Hall of Famer, a major-league baseball player and a graduate of the notoriously abusive Carlisle Indian School. Maraniss’s comprehensive biography highlights the great athlete’s successes and pains.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""4\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003EThe Mountain in the Sea, by Ray Nayler\u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EIn a near-future dystopia populated by humans, computerized constructs and at least one android, Dr. Ha Nguyen studies octopuses with language and culture living near an island owned by an international tech corporation. Her scientific breakthroughs lead to conflict between Nguyen, the larger world and the octopuses themselves.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""5\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003ERaising Lazarus: Hope, Justice, and the Future of America’s Overdose Crisis, by Beth Macy\u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EAfter exploring the causes of the opioid crisis in her 2018 book “Dopesick,” the journalist Macy turns her eye to solutions like harm reduction. The result, wrote our reviewer, Jan Hoffman, is Macy “at her full-bore fearless best. Heartsick and determined, she grills drug policy scholars and former drug czars alike.”\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""content-card css-yet5q6\"" data-index=\""6\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""content\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-6gi9n3\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cheader class=\""css-10odt3p\"" data-testid=\""title-byline\""\u003E\u003Cfigure class=\""css-1na6c6h\""\u003E\u003Cdiv class=\""css-ohwg9z\"" data-testid=\""image-holder\""\u003E\u003Cdiv data-testid=\""placeholder\"" class=\""css-9gujjy\""\u003E\u003Csvg width=\""100%\"" height=\""100%\"" xmlns=\""http:\u002F\u002Fwww.w3.org\u002F2000\u002Fsvg\"" version=\""1.1\""\u003E\u003C\u002Fsvg\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cfigcaption class=\""css-1wfdaj8\"" data-testid=\""legend\""\u003E\u003C\u002Ffigcaption\u003E\u003C\u002Ffigure\u003E\u003Cdiv class=\""css-ididjv\"" data-testid=\""subheadline\""\u003EMore Than You’ll Ever Know, by Katie Gutierrez\u003C\u002Fdiv\u003E\u003C\u002Fheader\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003EIn the 1980s, Lore Rivera secretly has two families, one in Texas, one in Mexico City, until her first husband finds out and murders the other. In 2017, the true-crime journalist Cassie Bowman is enticed by Rivera’s motivations for her double life. She learns more than she bargained for in this suspenseful debut novel.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E\u003Cdiv class=\""css-1mevlcl\"" aria-hidden=\""true\""\u003E\u003Cdiv class=\""exit-card css-bpzlko\"" data-index=\""7\"" data-dispatch-id=\""RGlzcGF0Y2g6Njg1NA==\"" data-items-length=\""8\"" data-card-type=\""exit\"" data-is-active=\""false\"" data-is-square-full-bleed=\""false\"" data-testid=\""card\""\u003E\u003Cdiv class=\""css-1m1wk0n\"" data-has-expandable-block=\""false\"" data-testid=\""document-block\""\u003E\u003Cdiv class=\""css-fsvbgy\"" data-testid=\""document-block-body\""\u003E\u003Cp class=\""css-131ft9l\""\u003E\u003Cstrong class=\""css-1nu2zqw\"" data-testid=\""bold\""\u003ERead more books news: \u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cul class=\""css-vaopzn\"" data-component=\""related-links-block\""\u003E\u003Cli class=\""related-link\""\u003E\u003Ca href=\""https:\u002F\u002Fwww.nytimes.com\u002F2023\u002F06\u002F22\u002Fbooks\u002Fbooksupdate\u002Fbookforum-the-nation.html\""\u003E\u003Cdiv data-testid=\""related-link-headline\"" class=\""css-1a7k0uh\""\u003EBookforum Is Returning, Months After Its Closure Was Mourned in the Literary World\u003C\u002Fdiv\u003E\u003C\u002Fa\u003E\u003Ca class=\""related-link-img\"" href=\""https:\u002F\u002Fwww.nytimes.com\u002F2023\u