        [Fact]
        public void EmptyPageUrl_ThrowsArguementNullException()
        {
            var uri = new Uri("https://www.nytimes.com/");
            var mockLogger = new Mock<ILogger<ScrapingService>>();
            var mockScrapingClient = new Mock<IScrapingClient>();

            mockScrapingClient.Setup(x => x.FetchHtmlAsync(uri)).Returns(Task.FromResult(_validHtml));
            //mockLogger.Setup(x => x.LogError());

            var service = new ScrapingService(mockScrapingClient.Object, mockLogger.Object);

            //act
            Func<Task> act = () => service.GetPageDataAsync(string.Empty);

            //assert
            Task<ArgumentNullException> exception = Assert.ThrowsAsync<ArgumentNullException>(act);

            //The thrown exception can be used for even more detailed assertions.
            Assert.Equal("Value cannot be null. (Parameter 'pageUrl')", exception?.Result.Message);
        }
    }
